import React from "react";
import { Formik } from "formik";
import Navbar from "../../components/Navbar/Navbar";
import "./Sign.css";
import FormInput from "../../components/FormInput/FormInput";

function SignPage() {
  return (
    <div className="sign-page">
      <Navbar login />
      <div className="form-container">

        <Formik
        className="formik-container"
          initialValues={{ email: "",username:"", password: "" }}          
          onSubmit={(values, { setSubmitting }) => {
            setTimeout(() => {
              alert(JSON.stringify(values, null, 2));
              setSubmitting(false);
            }, 400);
          }}
        >
          {({
            values,
            errors,
            touched,
            handleChange,
            handleBlur,
            handleSubmit,
            isSubmitting,
            /* and other goodies */
          }) => (
            <form className="input-container" onSubmit={handleSubmit}>
              <div className="sign-form-title">
                <p>Yeni bir hesap oluştur</p>
              </div>
              <FormInput title="E-mail" value={values.email} onChange={handleChange}/>
              <FormInput title="Kullanıcı Adı" value={values.username} onChange={handleChange}/>
              <FormInput title="Parola" value={values.password} nChange={handleChange}/>

              <div className="btn-container">
                <button className="btn-form" type="submit" disabled={isSubmitting}>
                  Hesap Olustur
                </button>
                <button className="btn-form" type="submit" disabled={isSubmitting}>
                  Hesap Olustur
                </button>
              </div>
            </form>
          )}
        </Formik>
        <img className="form-img" src="./images/movie-boy.svg" />
      </div>
    </div>
  );
}

export default SignPage;
